    "contracts/ProspektorFundManager.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;
pragma abicoder v2;

import "@openzeppelin/contracts/access/Ownable.sol";

import {IUniswapV3Pool} from "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol";
import {IUniswapV3Factory} from "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

import "./interfaces/IProspektorFundManager.sol";
import "./interfaces/ISwapRouter.sol";
import "./interfaces/INonfungiblePositionManager.sol";
import "./interfaces/IWETH.sol";
import "./interfaces/IPriceOracle.sol";

import "./utils/TransferHelper.sol";
import "./utils/ExecutorManager.sol";

import "hardhat/console.sol";

contract ProspektorFundManager is
    IProspektorFundManager,
    Ownable,
    ExecutorManager
{
    error LPError();

    IPriceOracle priceOracle;
    address vaultAddress;

    ISwapRouter uniswapRouter;
    IUniswapV3Pool public uniswapPool;
    INonfungiblePositionManager public nonfungiblePositionManager;
    IUniswapV3Factory public uniswapFactory;

    IERC20 public erc20Token;
    IERC20 public wethToken;

    uint24 private constant POOL_FEE = 10_000;

    uint256 public lpTokenId;

    constructor(
        address priceOracleAddress,
        address vaultAddress_,
        address uniswapRouterAddress,
        address uniswapFactoryAddress,
        address nonfungiblePositionManagerAddress,
        address erc20TokenAddress,
        address wethTokenAddress
    ) Ownable(msg.sender) ExecutorManager(msg.sender) {
        priceOracle = IPriceOracle(priceOracleAddress);
        vaultAddress = vaultAddress_;

        uniswapRouter = ISwapRouter(uniswapRouterAddress);

        uniswapFactory = IUniswapV3Factory(uniswapFactoryAddress);
        nonfungiblePositionManager = INonfungiblePositionManager(
            nonfungiblePositionManagerAddress
        );
        erc20Token = IERC20(erc20TokenAddress);
        wethToken = IERC20(wethTokenAddress);

        TransferHelper.safeApprove(
            erc20TokenAddress,
            address(vaultAddress),
            type(uint256).max
        );

        TransferHelper.safeApprove(
            erc20TokenAddress,
            address(nonfungiblePositionManager),
            type(uint256).max
        );

        TransferHelper.safeApprove(
            wethTokenAddress,
            address(nonfungiblePositionManager),
            type(uint256).max
        );

        TransferHelper.safeApprove(
            erc20TokenAddress,
            address(uniswapRouter),
            type(uint256).max
        );

        TransferHelper.safeApprove(
            wethTokenAddress,
            address(uniswapRouter),
            type(uint256).max
        );
    }

    function getPool(
        address erc20TokenAddress,
        address wethTokenAddress
    ) public view returns (IUniswapV3Pool) {
        return
            IUniswapV3Pool(
                uniswapFactory.getPool(
                    erc20TokenAddress,
                    wethTokenAddress,
                    POOL_FEE
                )
            );
    }

    function getTick() public view returns (int24) {
        (, int24 tick, , , , , ) = getPool(
            address(erc20Token),
            address(wethToken)
        ).slot0();
        return (tick);
    }

    function _mintLiquidityPosition(
        uint desiredTokenAmount,
        uint desiredWethAmount,
        int24 tickLower,
        int24 tickUpper
    )
        private
        returns (
            uint256 tokenId,
            uint128 liquidity,
            uint256 erc20Amount,
            uint256 wethAmount
        )
    {
        (
            tokenId,
            liquidity,
            erc20Amount,
            wethAmount
        ) = nonfungiblePositionManager.mint(
            INonfungiblePositionManager.MintParams({
                token0: address(erc20Token),
                token1: address(wethToken),
                fee: POOL_FEE,
                tickLower: tickLower,
                tickUpper: tickUpper,
                amount0Desired: desiredTokenAmount,
                amount1Desired: desiredWethAmount,
                amount0Min: 0,
                amount1Min: 0,
                recipient: address(this),
                deadline: block.timestamp
            })
        );

        require(tokenId != 0, "FAILED_CREATION");

        lpTokenId = tokenId;

        return (lpTokenId, liquidity, erc20Amount, wethAmount);
    }

    function _addLiquidity(
        uint erc20Amount,
        uint wethAmount
    )
        private
        returns (
            uint128 liquidity,
            uint256 erc20TokenValue,
            uint256 wethTokenValue
        )
    {
        (
            liquidity,
            erc20TokenValue,
            wethTokenValue
        ) = nonfungiblePositionManager.increaseLiquidity(
            INonfungiblePositionManager.IncreaseLiquidityParams({
                tokenId: lpTokenId,
                amount0Desired: erc20Amount,
                amount1Desired: wethAmount,
                amount0Min: 0,
                amount1Min: 0,
                deadline: block.timestamp
            })
        );
    }

    function addLiquidity(
        uint erc20Amount,
        uint wethAmount
    )
        public
        returns (
            uint128 liquidity,
            uint256 erc20TokenValue,
            uint256 wethTokenValue
        )
    {
        require(
            erc20Token.transferFrom(msg.sender, address(this), erc20Amount),
            "0"
        );
        require(
            wethToken.transferFrom(msg.sender, address(this), wethAmount),
            "1"
        );

        (liquidity, erc20TokenValue, wethTokenValue) = _addLiquidity(
            erc20Amount,
            wethAmount
        );

        uint256 erc20TokenBalance = erc20Token.balanceOf(address(this));
        if (erc20TokenBalance > 0) {
            require(
                erc20Token.transfer(address(msg.sender), erc20TokenBalance),
                "2"
            );
        }

        uint256 wethTokenBalance = wethToken.balanceOf(address(this));
        if (wethTokenBalance > 0) {
            require(
                wethToken.transfer(address(msg.sender), wethTokenBalance),
                "3"
            );
        }
    }

    function createInitialLP(
        uint256 erc20Amount,
        uint256 wethAmount,
        int24 minTick_,
        int24 maxTick_
    ) external onlyOwner {
        require(
            erc20Token.transferFrom(msg.sender, address(this), erc20Amount),
            "0"
        );

        require(
            wethToken.transferFrom(msg.sender, address(this), wethAmount),
            "1"
        );

        (
            ,
            ,
            uint256 addedToken,
            uint256 addedWethToken
        ) = _mintLiquidityPosition(erc20Amount, wethAmount, minTick_, maxTick_);

        if (addedToken < erc20Amount) {
            erc20Token.approve(msg.sender, erc20Amount - addedToken);
            require(
                erc20Token.transfer(msg.sender, erc20Amount - addedToken),
                "2"
            );
        }

        if (addedWethToken < wethAmount) {
            wethToken.approve(msg.sender, wethAmount - addedWethToken);
            require(
                wethToken.transfer(msg.sender, wethAmount - addedWethToken),
                "3"
            );
        }
    }

    function collectLPFees()
        public
        onlyOwner
        returns (uint256 erc20Amount, uint256 wethAmount)
    {
        (erc20Amount, wethAmount) = _collectLPFees(address(this));

        /// @notice Swap weth for ERC20
        if (wethAmount > 0)
            _swapTokens(
                address(wethToken),
                address(erc20Token),
                vaultAddress,
                wethAmount
            );

        /// @notice Assumes recipient is always approved by contract
        require(IERC20(erc20Token).transfer(vaultAddress, erc20Amount));
    }

    function _collectLPFees(
        address recipient
    ) private returns (uint256, uint256) {
        return
            nonfungiblePositionManager.collect(
                INonfungiblePositionManager.CollectParams({
                    tokenId: lpTokenId,
                    recipient: recipient,
                    amount0Max: type(uint128).max,
                    amount1Max: type(uint128).max
                })
            );
    }

    function getPosition()
        public
        view
        returns (
            uint96 nonce,
            address operator,
            address erc20Token_,
            address wethToken_,
            uint24 fee,
            int24 tickLower,
            int24 tickUpper,
            uint128 liquidity,
            uint256 feeGrowthInside0LastX128,
            uint256 feeGrowthInside1LastX128,
            uint128 tokensOwed0,
            uint128 tokensOwed1
        )
    {
        return nonfungiblePositionManager.positions(lpTokenId);
    }

    function _swapTokens(
        address fromToken,
        address toToken,
        address recipient,
        uint256 amountIn
    ) private returns (uint256) {
        return
            uniswapRouter.exactInputSingle(
                ISwapRouter.ExactInputSingleParams({
                    tokenIn: fromToken,
                    tokenOut: toToken,
                    fee: POOL_FEE,
                    recipient: recipient,
                    // deadline: block.timestamp,
                    amountIn: amountIn,
                    amountOutMinimum: 2,
                    sqrtPriceLimitX96: 0
                })
            );
    }

    function onERC721Received(
        address,
        address,
        uint256,
        bytes calldata
    ) external pure returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
"
    },
    "contracts/utils/ExecutorManager.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

abstract contract ExecutorManager {
    error NotExecutor(address attempted);
    error CannotRemoveSelf();

    mapping(address => bool) public executors;

    constructor(address initialExecutor) {
        _addExecutor(initialExecutor);
    }

    modifier onlyExecutor() {
        if (isExecutor(msg.sender) != true) revert NotExecutor(msg.sender);
        _;
    }

    function isExecutor(address _executor) public view returns (bool) {
        return (executors[_executor] == true);
    }

    function _addExecutor(address _toAdd) internal {
        executors[_toAdd] = true;
    }

    function addExecutor(address _toAdd) external virtual onlyExecutor {
        _addExecutor(_toAdd);
    }

    function _removeExecutor(address _toRemove) internal {
        if (_toRemove == msg.sender) revert CannotRemoveSelf();
        executors[_toRemove] = false;
    }

    function removeExecutor(address _toRemove) external virtual onlyExecutor {
        _removeExecutor(_toRemove);
    }
}
"
    },
    "contracts/utils/TransferHelper.sol": {
      "content": "// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.6.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

library TransferHelper {
    /// @notice Transfers tokens from the targeted address to the given destination
    /// @notice Errors with 'STF' if transfer fails
    /// @param token The contract address of the token to be transferred
    /// @param from The originating address from which the tokens will be transferred
    /// @param to The destination address of the transfer
    /// @param value The amount to be transferred
    function safeTransferFrom(
        address token,
        address from,
        address to,
        uint256 value
    ) internal {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSelector(
                IERC20.transferFrom.selector,
                from,
                to,
                value
            )
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "STF"
        );
    }

    /// @notice Transfers tokens from msg.sender to a recipient
    /// @dev Errors with ST if transfer fails
    /// @param token The contract address of the token which will be transferred
    /// @param to The recipient of the transfer
    /// @param value The value of the transfer
    function safeTransfer(address token, address to, uint256 value) internal {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSelector(IERC20.transfer.selector, to, value)
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "ST"
        );
    }

    /// @notice Approves the stipulated contract to spend the given allowance in the given token
    /// @dev Errors with 'SA' if transfer fails
    /// @param token The contract address of the token to be approved
    /// @param to The target of the approval
    /// @param value The amount of the given token the target will be allowed to spend
    function safeApprove(address token, address to, uint256 value) internal {
        (bool success, bytes memory data) = token.call(
            abi.encodeWithSelector(IERC20.approve.selector, to, value)
        );
        require(
            success && (data.length == 0 || abi.decode(data, (bool))),
            "SA"
        );
    }

    /// @notice Transfers ETH to the recipient address
    /// @dev Fails with `STE`
    /// @param to The destination of the transfer
    /// @param value The value to be transferred
    function safeTransferETH(address to, uint256 value) internal {
        (bool success, ) = to.call{value: value}(new bytes(0));
        require(success, "STE");
    }
}
"
